selector_to_html = {"a[href=\"#determinantmetoden\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">3.4.3. </span>Determinantmetoden<a class=\"headerlink\" href=\"#determinantmetoden\" title=\"Permalink til denne overskrift\">#</a></h2><p>Determinantmetoden er en lidt mere kompliceret udgave af lige store koefficienters metode. Her stiller vi ligningerne op i en bestemt orden og r\u00e6kkef\u00f8lge.</p>", "a[href=\"#lige-store-koefficienters-metode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">3.4.2. </span>Lige store koefficienters metode<a class=\"headerlink\" href=\"#lige-store-koefficienters-metode\" title=\"Permalink til denne overskrift\">#</a></h2><p>Lige store koefficienters metode g\u00e5r ud p\u00e5, som navnet indikerer, at f\u00e5 koefficienterne for en af de to ubekendte i de to ligninger til at blive lige store, og s\u00e5 p\u00e5 den m\u00e5de s\u00e6tte ligningerne lig hinanden.</p>", "a[href=\"#opgaver\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">3.4.5. </span>Opgaver<a class=\"headerlink\" href=\"#opgaver\" title=\"Permalink til denne overskrift\">#</a></h2>", "a[href=\"#gauss-elimination\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">3.4.4. </span>Gauss-elimination<a class=\"headerlink\" href=\"#gauss-elimination\" title=\"Permalink til denne overskrift\">#</a></h2><p>En helt fjerde metode, der is\u00e6r anvendes inden for line\u00e6r algebra, er Gauss-eliminations algoritmen. Den er is\u00e6r anvendelig for st\u00f8rre ligningssystemer. Forestil dig at skulle bruge substitutionsmetoden for fem ligninger med fem ubekendte - det ville blive ret s\u00e5 uoverskueligt!</p><p>Den overordnede id\u00e9 med denne metode er, at man kan samle koefficienterne for de forskellige variable i en matrix og reducere den til det, der kaldes en reduceret trappeform og direkte afl\u00e6se ligningssystemets l\u00f8sning. Det g\u00f8res ved at bruge ligningerne p\u00e5 hinanden ved at tr\u00e6kke dem fra hinanden, l\u00e6gge dem til hinanden eller gange et tal p\u00e5 ligningen. Vi vil ikke g\u00e5 matematikken i dybden, men blot blive bekendt med metoden.</p>", "a[href=\"lighed-og-ligevaegt.html#lighedogligevaegt\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">3.1. </span>Lighed, ligev\u00e6gtsprincip og \u00e6kvivalens<a class=\"headerlink\" href=\"#lighed-ligevaegtsprincip-og-aekvivalens\" title=\"Permalink til denne overskrift\">#</a></h1><p>Ligninger er matematiske udtryk, der indeholder et lighedstegn og en ubekendt, som er den, vi er interesseret i at bestemme. Oftest kalder vi den ubekendte for <span class=\"math notranslate nohighlight\">\\(x\\)</span>. For eksempel er</p>", "a[href=\"#indsaettelsesmetoden\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">3.4.1. </span>Inds\u00e6ttelsesmetoden<a class=\"headerlink\" href=\"#indsaettelsesmetoden\" title=\"Permalink til denne overskrift\">#</a></h2><p>Inds\u00e6ttelsesmetoden er en meget vigtig metode, som du b\u00f8r \u00f8ve s\u00e5 meget, at den kommer til at ligge p\u00e5 rygraden. Id\u00e9en med metoden er, at isolere for en af de ubekendte i den ene ligning og s\u00e5 inds\u00e6tte det udtryk i den anden ligning.</p><p>Lad os kigge p\u00e5 et eksempel:</p>", "a[href=\"#to-ligninger-med-to-ubekendte\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">3.4. </span>To ligninger med to ubekendte<a class=\"headerlink\" href=\"#to-ligninger-med-to-ubekendte\" title=\"Permalink til denne overskrift\">#</a></h1><p>Du kan ogs\u00e5 komme ud for at skulle l\u00f8se to ligninger med to ubekendte. Vi udvider nu vores sidste kapitel med en ny ligning og en ny variabel, som vi oftest vil kalde <span class=\"math notranslate nohighlight\">\\(y\\)</span>. Et eksempel p\u00e5 to ligninger med to ubekendte kunne v\u00e6re:</p>", "a[href=\"#reducedmatrix\"]": "<figure class=\"align-default\" id=\"reducedmatrix\">\n<a class=\"reference internal image-reference\" href=\"../../../_images/reducedmatrix.png\"><img alt=\"../../../_images/reducedmatrix.png\" src=\"../../../_images/reducedmatrix.png\" style=\"width: 85%;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">figur 3.2 </span><span class=\"caption-text\">En reduceret trappe-matrix. <br/>\nEn s\u00e5dan matrix har 0\u2019erne i den \u00f8vre h\u00f8jre del og nedre venstre del. Der er kun tal i diagonalen.</span><a class=\"headerlink\" href=\"#reducedmatrix\" title=\"Permahenvisning til dette billede\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#matrix\"]": "<figure class=\"align-default\" id=\"matrix\">\n<a class=\"reference internal image-reference\" href=\"../../../_images/matrix.png\"><img alt=\"../../../_images/matrix.png\" src=\"../../../_images/matrix.png\" style=\"width: 100%;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">figur 3.1 </span><span class=\"caption-text\">En matrix. <br/>\nI stedet for alle <span class=\"math notranslate nohighlight\">\\(a\\)</span>\u2019erne, s\u00e5 kan du forestille dig, at der st\u00e5r tal.</span><a class=\"headerlink\" href=\"#matrix\" title=\"Permahenvisning til dette billede\">#</a></p>\n</figcaption>\n</figure>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
